import React from 'react'
import './Main.css'
import img from '../img/짭쥐 표지-18_cut.png'
import icon1 from '../img/map.png';
import icon2 from '../img/book.png';
import icon3 from '../img/clothes.png';
import icon4 from '../img/cooking.png';
import icon5 from '../img/news.png';

import M_book from './pages/M_book';
import M_cook from './pages/M_cook';
import M_fashion from './pages/M_fashion';
import M_news from './pages/M_news';
import M_traval from './pages/M_traval';
import { BrowserRouter, Routes,Route } from 'react-router-dom';

const Main = () => {

  // logo css
  const back = {
    display: 'flex',
    justifyContent: 'center',
    bottom:0,
    width:'100vw',
    height:'20vw',
    backgroundColor:'#3e448b'
  }


  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/main/traval' element={<M_traval/>}/>
          <Route path='/main/book' element={<M_book/>}/>
          <Route path='/main/fashion' element={<M_fashion/>}/>
          <Route path='/main/cook' element={<M_cook/>}/>
          <Route path='/main/news' element={<M_news/>}/>
        </Routes>
      </BrowserRouter>
      <div style={back}>
        <img src={img} style={{width:'90%', height:'90%'}}/>
      </div>
      {/* 아이콘 페이지 */}
      <div className='iconCon'>
        <img className='icon aa' src={icon1}/>
        <img className='icon bb' src={icon2}/>
        <img className='icon cc' src={icon3}/>
        <img className='icon dd' src={icon4}/>
        <img className='icon ee' src={icon5}/>
      </div>
      <div className='explain'>
        <div>
          <div>map</div>
        </div>
      </div>
    </div>
  )
}

export default Main
